import React from "react";
import { Grid, TextField, InputAdornment } from "@mui/material";
import { Search } from "@mui/icons-material";
import { Selectbar } from "./Selectbar";
import { Fetching } from "./Fetching";

export const Products = () => {
  return (
    <>
      <Grid
        container
        spacing={2}
        sx={{
          position: "fixed",
          //   top: 0,
          //   width: "100%",
          //   zIndex: 1000,
          backgroundColor: "#fff",
          padding: "10px",
        }}
      >
        <Grid item xs={6}>
          <TextField
            sx={{
              "& .MuiOutlinedInput-root": {
                borderRadius: "20px",
              },
            }}
            variant="outlined"
            label="Search..."
            fullWidth
            InputProps={{
              endAdornment: (
                <InputAdornment position="end">
                  <Search />
                </InputAdornment>
              ),
            }}
          />
        </Grid>
        <Grid item xs={6}>
          <Selectbar />
        </Grid>
      </Grid>
      <Grid container spacing={2} sx={{ marginTop: "80px" }}>
        <Grid item xs={12}>
          <Fetching />
        </Grid>
      </Grid>
    </>
  );
};
